BEGIN
delete from  `rp_period_in_out` where  username = username;

`create_by`,
`date_period`,
`username`,
`goods_id`,
`goods_name`,
`goods_unit`,
`goods_guige`,
`goods_qc`,
`goods_in`,
`goods_out`,
`goods_qm`,
`goods_now`)
