            mdp.goods_id) as id,
    wmdate as his_date,
    mdp.cus_code,
    mdp.ku_wei_bian_ma,
    mdp.bin_id,
    mdp.goods_id,
    sum(base_goodscount) as count,
    mdp.base_unit
 
FROM
    mv_down_and_up mdp
where
    (mdp.leixing = 'S'
        and to_days(mdp.create_date) <= to_days(wmdate))
        or (mdp.leixing = 'H'
        and to_days(mdp.create_date) <= to_days(wmdate))
        
group by mdp.cus_code , mdp.ku_wei_bian_ma , mdp.bin_id,mdp.goods_id
having sum(base_goodscount) <> 0
order by cus_code , create_date;



END
