-- ----------------------------
-- Triggers structure for table wm_in_qm_i
-- ----------------------------
DROP TRIGGER IF EXISTS `wm_in_gr`;
delimiter ;;
CREATE TRIGGER `wm_in_gr` AFTER INSERT ON `wm_in_qm_i` FOR EACH ROW begin

set @notice_id = new.im_notice_id;

set @newid = new.im_notice_item;

set @id = new.id;

set @tj = new.tin_tj;

set @goodid = new.goods_id;

update wm_im_notice_i 

set 

    goods_qm_count = (select 

            sum(qm_ok_quat)

        from

            wm_in_qm_i

        where

            im_notice_item = @newid)

where

    id = @newid;

update wm_im_notice_i 

set 

    bin_pre = 'Y'

where

    id = @newid

and 

    goods_count = (select 

            sum(qm_ok_quat)

        from

            wm_in_qm_i

        where

            im_notice_item = @newid);



update wm_im_notice_h 

set  im_sta = '操作中'

where notice_id = @notice_id ;

end
;;
delimiter ;

