-- ----------------------------
-- Triggers structure for table wm_om_qm_i
-- ----------------------------
DROP TRIGGER IF EXISTS `wm_omqm_update`;
delimiter ;;
CREATE TRIGGER `wm_omqm_update` AFTER UPDATE ON `wm_om_qm_i` FOR EACH ROW begin

if new.wave_id is not null then

update wm_om_notice_h set om_sta = '复核中'  where om_notice_id = new.om_notice_id and (select count(*) from wm_om_qm_i  where om_notice_id =  new.om_notice_id and bin_sta = 'Z') > 0;

end if;

end
;;
