-- ----------------------------
-- Triggers structure for table wm_to_down_goods
-- ----------------------------
DROP TRIGGER IF EXISTS `wm_down`;
delimiter ;;
CREATE TRIGGER `wm_down` AFTER INSERT ON `wm_to_down_goods` FOR EACH ROW begin

if new.order_type = '99' then

update wm_om_qm_i set bin_sta = 'Y' where wave_id = new.order_id and bin_id = new.ku_wei_bian_ma  and tin_id = new.bin_id_from and pro_data = new.goods_pro_data and goods_id = new.goods_id ;

else

update wm_om_notice_h set om_sta = '操作中'  where om_notice_id = new.order_id;

update wm_om_qm_i set bin_sta = 'Y' where id = new.order_id_i;

end if;

end
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table wm_to_down_goods
-- ----------------------------
DROP TRIGGER IF EXISTS `wm_down_update`;
delimiter ;;
CREATE TRIGGER `wm_down_update` AFTER UPDATE ON `wm_to_down_goods` FOR EACH ROW begin

if new.order_type = '99' then

update wm_om_qm_i set bin_sta = 'H' where wave_id = new.order_id and goods_id = new.goods_id  and (select count(*) from wm_to_down_goods  where order_id =  new.order_id and goods_id = new.goods_id and down_sta is null ) = 0;

else

update wm_om_notice_h set om_sta = '复核完成'  where om_notice_id = new.order_id and (select count(*) from wm_to_down_goods  where order_id =  new.order_id and down_sta is null ) = 0;

end if;

end
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table wm_to_up_goods
-- ----------------------------
DROP TRIGGER IF EXISTS `wm_up_gr`;
delimiter ;;
CREATE TRIGGER `wm_up_gr` AFTER INSERT ON `wm_to_up_goods` FOR EACH ROW begin

update wm_in_qm_i set  bin_sta = 'Y'  where id =  new.order_id_i;

update wm_im_notice_h set  im_sta = '已完成'  where notice_id =  new.order_id and (select count(*) from wm_im_notice_i where im_notice_id =  new.order_id and bin_pre = 'N' ) = 0;

end
;;
delimiter ;

